import './App.css';

function fetchData() {
    fetch('http://localhost:3001/download/mp3')
    .then(res => res.json())
    .then(json => console.log(json))
}

function App() {
    return (<div>
        <h1>Youtube MP3 Downloader</h1>
        <button onClick={fetchData}>Download</button>
    </div>)
}

export default App;
